syntax = "proto3";

package omo.msp.vocabulary;
option go_package= "proto/vocabulary";
import "proto/vocabulary/common.proto";


service ImportService {
    rpc BatchImport(ReqBatchImport) returns (ReplyInfo) {}
}

message ReqBatchImport {
  string template = 1;
  string file = 2;
  string operator = 3;
}

